import React, { Component } from 'react';
import {Row, Col, Breadcrumb, CardHeader, CardBody} from 'reactstrap';
import {Route} from 'react-router-dom';
import Breadcrumbs from './Breadcrumbs';
import Header from './Header';
import ProductList from './ProductList';
import Product from './Product';
import Footer from './Footer'

//Utilizamos el combineReducers con el fin de administrar los estados, de esta manera cada estado tiene asociado  
//una funcion que se encargara de su adminsitración 
const reducer = combineReducers({
    ReducerSearch: ReducerSearch.RSearch, 
});

//Donde almacenamos nuestro estado
const store = createStore(reducer, applyMiddleware(thunk, promise));

class Canvan extends Component{
	constructor(props) {
		super(props);
		this.state = {}
    }

    componentDidMount(){}

	render(){
        const pos = {pag:"12", center:{size: 10, offset: 1}}
		return(
            <Row>
                <Col xs={pos.pag} sm={pos.pag} md={pos.pag}>
                    <CardHeader>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Header/>
                        </Col>
                    </CardHeader>
                    <Breadcrumb>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Breadcrumbs/>
                        </Col>
                    </Breadcrumb>
                    <CardBody>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <BrowserRouter ref={this.props.innerRef}>
                                <Provider store={store}>
                                    <Suspense fallback={<div>Loading Módulo...</div>}>
                                        <Switch>
                                            <Route path="/" component={ProductList} exact/>
                                            <Route path="/items/:id" component={Product} exact/>
                                        </Switch>
                                    </Suspense>
                                </Provider>
                            </BrowserRouter> 
                        </Col>
                    </CardBody>
                    <CardBody>
                        <Col xs={pos.center} sm={pos.center} md={pos.center}>
                            <Footer/>
                        </Col>
                    </CardBody>
                </Col>
            </Row>
		)	
	}
}

export default Canvan;
